An object that defines named values whose value is managed by function calls.
The names of the properties of this object are assigned as values in the
ViewModel.

For example:

     formulas: {
         xy: function (get) { return get('x') * get('y'); }
     }

For more details about defining a formula, see <a href='#!/api/Ext.app.bind.Formula'>Ext.app.bind.Formula</a>.

Links provide a way to assign a simple name to a more complex bind. The primary
use for this is to assign names to records in the data model.

     links: {
         theUser: {
             type: 'User',
             id: 12
         }
     }

It is also possible to force a new phantom record to be created by not specifying an
id but passing `create: true` as part of the descriptor. This is often useful when
creating a new record for a child session.

    links: {
        newUser: {
            type: 'User',
            create: true
        }
    }

`create` can also be an object containing initial data for the record.

    links: {
        newUser: {
            type: 'User',
            create: {
                firstName: 'John',
                lastName: 'Smith'
            }
        }
    }

While that is the typical use, the value of each property in <a href='#!/api/Ext.ux.colorpick.SelectorModel-cfg-links'>links</a> may also be
a bind descriptor (see <a href='#!/api/Ext.ux.colorpick.SelectorModel-method-bind'>method-bind</a> for the various forms of bind
descriptors).

A declaration of <a href='#!/api/Ext.data.Store'>Ext.data.Store</a> configurations that are first processed as
binds to produce an effective store configuration.

A simple store definition. We can reference this in our bind statements using the
`{users}` as we would with other data values.

    new Ext.app.ViewModel({
        stores: {
            users: {
                model: 'User',
                autoLoad: true
            }
        }
    });

This store definition contains a dynamic binding. The store will not be created until
the initial value for groupId is set. Once that occurs, the store is created with the appropriate
filter configuration. Subsequently, once we change the group value, the old filter will be
overwritten with the new value.

    var viewModel = new Ext.app.ViewModel({
        stores: {
            users: {
                model: 'User',
                filters: [{
                    property: 'groupId',
                    value: '{groupId}'
                }]
            }
        }
    });
    viewModel.set('groupId', 1); // This will trigger the store creation with the filter.
    viewModel.set('groupId', 2); // The filter value will be changed.

This store uses <a href='#!/api/Ext.data.ChainedStore'>Ext.data.ChainedStore</a> to create a store backed by the
data in another store. By specifying a string as the store, it will bind our creation and backing
to the other store. This functionality is especially useful when wanting to display a different "view"
of a store, for example a different sort order or different filters.

    var viewModel = new Ext.app.ViewModel({
        stores: {
            allUsers: {
                model: 'User',
                autoLoad: true
            },
            children: {
                source: '{allUsers}',
                filters: [{
                    property: 'age',
                    value: 18,
                    operator: '<'
                }]
            }
        }
    });

This method requests that data in this `ViewModel` be delivered to the specified
`callback`. The data desired is given in a "bind descriptor" which is the first
argument.

A simple call might look like this:

    var binding = vm.bind('{foo}', this.onFoo, this);

    binding.destroy();  // when done with the binding

Options for the binding can be provided in the last argument:

    var binding = vm.bind('{foo}', this.onFoo, this, {
        deep: true
    });

Alternatively, bind options can be combined with the bind descriptor using only
the first argument:

    var binding = vm.bind({
        bindTo: '{foo}',  // the presence of bindTo identifies this form
        deep: true
    }, this.onFoo, this);

See the class documentation for more details on Bind Descriptors and options.

Returns a boolean indicating whether an object contains the specified property as a direct property
of that object and not inherited through the prototype chain.

Every object descended from <a href='#!/api/Object'>Object</a> inherits the <a href='#!/api/Ext.ux.colorpick.SelectorModel-method-hasOwnProperty'>hasOwnProperty</a> method. This method can be used
to determine whether an object has the specified property as a direct property of that object;
unlike the `in` operator, this method does not check down the object's prototype chain.

The following example determines whether the o object contains a property named prop:

    o = new Object();
    o.prop = 'exists';

    function changeO() {
        o.newprop = o.prop;
        delete o.prop;
    }

    o.hasOwnProperty('prop');   //returns true
    changeO();
    o.hasOwnProperty('prop');   //returns false

The following example differentiates between direct properties and properties inherited through the
prototype chain:

    o = new Object();
    o.prop = 'exists';
    o.hasOwnProperty('prop');             // returns true
    o.hasOwnProperty('toString');         // returns false
    o.hasOwnProperty('hasOwnProperty');   // returns false

The following example shows how to iterate over the properties of an object without executing on
inherit properties.

    var buz = {
        fog: 'stack'
    };

    for (var name in buz) {
        if (buz.hasOwnProperty(name)) {
            alert("this is fog (" + name + ") for sure. Value: " + buz[name]);
        }
        else {
            alert(name); // toString or something else
        }
    }

Returns a boolean indication whether the specified object is in the prototype chain of the object
this method is called upon.

<a href='#!/api/Ext.ux.colorpick.SelectorModel-method-isPrototypeOf'>isPrototypeOf</a> allows you to check whether or not an object exists within another object's
prototype chain.

For example, consider the following prototype chain:

    function Fee() {
        // . . .
    }

    function Fi() {
        // . . .
    }
    Fi.prototype = new Fee();

    function Fo() {
        // . . .
    }
    Fo.prototype = new Fi();

    function Fum() {
        // . . .
    }
    Fum.prototype = new Fo();

Later on down the road, if you instantiate `Fum` and need to check if `Fi`'s prototype exists
within the `Fum` prototype chain, you could do this:

    var fum = new Fum();
    . . .

    if (Fi.prototype.isPrototypeOf(fum)) {
    // do something safe
    }

This, along with the `instanceof` operator particularly comes in handy if you have code that can
only function when dealing with objects descended from a specific prototype chain, e.g., to
guarantee that certain methods or properties will be present on that object.

Returns a boolean indicating if the internal ECMAScript DontEnum attribute is set.

Every object has a <a href='#!/api/Ext.ux.colorpick.SelectorModel-method-propertyIsEnumerable'>propertyIsEnumerable</a> method. This method can determine whether the specified
property in an object can be enumerated by a `for...in` loop, with the exception of properties
inherited through the prototype chain. If the object does not have the specified property, this
method returns false.

The following example shows the use of <a href='#!/api/Ext.ux.colorpick.SelectorModel-method-propertyIsEnumerable'>propertyIsEnumerable</a> on objects and arrays:

    var o = {};
    var a = [];
    o.prop = 'is enumerable';
    a[0] = 'is enumerable';

    o.propertyIsEnumerable('prop');   // returns true
    a.propertyIsEnumerable(0);        // returns true

The following example demonstrates the enumerability of user-defined versus built-in properties:

    var a = ['is enumerable'];

    a.propertyIsEnumerable(0);          // returns true
    a.propertyIsEnumerable('length');   // returns false

    Math.propertyIsEnumerable('random');   // returns false
    this.propertyIsEnumerable('Math');     // returns false

Direct versus inherited properties

    var a = [];
    a.propertyIsEnumerable('constructor');         // returns false

    function firstConstructor()
    {
        this.property = 'is not enumerable';
    }
    firstConstructor.prototype.firstMethod = function () {};

    function secondConstructor()
    {
        this.method = function method() { return 'is enumerable'; };
    }

    secondConstructor.prototype = new firstConstructor;
    secondConstructor.prototype.constructor = secondConstructor;

    var o = new secondConstructor();
    o.arbitraryProperty = 'is enumerable';

    o.propertyIsEnumerable('arbitraryProperty');   // returns true
    o.propertyIsEnumerable('method');              // returns true
    o.propertyIsEnumerable('property');            // returns false

    o.property = 'is enumerable';

    o.propertyIsEnumerable('property');            // returns true

    // These return false as they are on the prototype which
    // propertyIsEnumerable does not consider (even though the last two
    // are iteratable with for-in)
    o.propertyIsEnumerable('prototype'); // returns false (as of JS 1.8.1/FF3.6)
    o.propertyIsEnumerable('constructor'); // returns false
    o.propertyIsEnumerable('firstMethod'); // returns false

The data to set at the value. If the value is an object literal,
any required paths will be created.

    // Set a single property at the root level
    viewModel.set('expiry', Ext.Date.add(new Date(), Ext.Date.DAY, 7));
    console.log(viewModel.get('expiry'));
    // Sets a single property in user.address, does not overwrite any hierarchy.
    viewModel.set('user.address.city', 'London');
    console.log(viewModel.get('user.address.city'));
    // Sets 2 properties of "user". Overwrites any existing hierarchy.
    viewModel.set('user', {firstName: 'Foo', lastName: 'Bar'});
    console.log(viewModel.get('user.firstName'));
    // Sets a single property at the root level. Overwrites any existing hierarchy.
    viewModel.set({rootKey: 1});
    console.log(viewModel.get('rootKey'));

Returns a string representation of the object.

Every object has a `toString()` method that is automatically called when the object is to be
represented as a text value or when an object is referred to in a manner in which a string is
expected. By default, the `toString()` method is inherited by every object descended from <a href='#!/api/Object'>Object</a>.
If this method is not overridden in a custom object, `toString()` returns "[object type]", where
`type` is the object type. The following code illustrates this:

    var o = new Object();
    o.toString();           // returns [object Object]

You can create a function to be called in place of the default `toString()` method. The
`toString()` method takes no arguments and should return a string. The `toString()` method you
create can be any value you want, but it will be most useful if it carries information about the
object.

The following code defines the `Dog` object type and creates `theDog`, an object of type `Dog`:

    function Dog(name,breed,color,sex) {
        this.name=name;
        this.breed=breed;
        this.color=color;
        this.sex=sex;
    }

    theDog = new Dog("Gabby","Lab","chocolate","female");

If you call the `toString()` method on this custom object, it returns the default value inherited
from <a href='#!/api/Object'>Object</a>:

    theDog.toString(); //returns [object Object]

The following code creates and assigns `dogToString()` to override the default `toString()` method.
This function generates a string containing the name, breed, color, and sex of the object, in the
form `"property = value;"`.

    Dog.prototype.toString = function dogToString() {
        var ret = "Dog " + this.name + " is a " + this.sex + " " + this.color + " " + this.breed;
        return ret;
    }

With the preceding code in place, any time theDog is used in a string context, JavaScript
automatically calls the `dogToString()` function, which returns the following string:

    Dog Gabby is a female chocolate Lab

`toString()` can be used with every object and allows you to get its class. To use the
`Object.prototype.toString()` with every object, you need to call `Function.prototype.call()` or
`Function.prototype.apply()` on it, passing the object you want to inspect as the first parameter
called `thisArg`.

    var toString = Object.prototype.toString;

    toString.call(new Date); // [object Date]
    toString.call(new String); // [object String]
    toString.call(Math); // [object Math]

 Specifies the function that creates an object's prototype.

 Returns a reference to the Object function that created the instance's prototype. Note that the
 value of this property is a reference to the function itself, not a string containing the
 function's name, but it isn't read only (except for primitive Boolean, Number or String values: 1,
 true, "read-only").

 All objects inherit a `constructor` property from their <a href='#!/api/Ext.ux.colorpick.SelectorModel-property-prototype'>prototype</a>:

     o = new Object // or o = {} in JavaScript 1.2
     o.constructor == Object
     a = new Array // or a = [] in JavaScript 1.2
     a.constructor == Array
     n = new Number(3)
     n.constructor == Number

 Even though you cannot construct most HTML objects, you can do comparisons. For example,

     document.constructor == Document
     document.form3.constructor == Form

 The following example creates a prototype, `Tree`, and an object of that type, theTree. The example then displays the `constructor` property for the object `theTree`.

     function Tree(name) {
         this.name = name;
     }
     theTree = new Tree("Redwood");
     console.log("theTree.constructor is " + theTree.constructor);

 This example displays the following output:

     theTree.constructor is function Tree(name) {
         this.name = name;
     }

 The following example shows how to modify constructor value of generic objects. Only true, 1 and
 "test" variable constructors will not be changed. This example explains that is not always so safe
 to believe in constructor function.

     function Type(){};
     var	types = [
 	    new Array,	[],
	    new Boolean,	true,
	    new Date,
	    new Error,
	    new Function,	function(){},
	    Math,
	    new Number,	1,
	    new Object,	{},
	    new RegExp,	/(?:)/,
	    new String,	"test"
     ];
     for(var i = 0; i < types.length; i++){
         types[i].constructor = Type;
         types[i] = [types[i].constructor, types[i] instanceof Type, types[i].toString()];
     };
     alert(types.join("\n"));
